import React from 'react';import './App.css';import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import WhiskyList from './components/WhiskyList';

function App() {
  return (
    <>
      <WhiskyList />
        <Router>
            <Routes>
                <Route path="/whiskies" element={<WhiskyListPage />} />
            </Routes>
        </Router>
    </>
  );
}

export default App;
